  given(toBeUpdatedKey.getBucketName()).willReturn("bucket1");
  given(toBeUpdatedKey.getKeyName()).willReturn("updatedKey");
  given(toBeUpdatedKey.getDataSize()).willReturn(10000L); // Bin 4
