    assertProgramSystemMetadata(Program.from(app, MAPREDUCE, NAME), "Batch");
    assertProgramSystemMetadata(Program.from(app, SPARK, NAME), "Batch");
    assertProgramSystemMetadata(Program.from(app, WORKFLOW, NAME), "Batch");
}

