                            .append('\uD800')
                            .toString();
    ByteBuf buf = Unpooled.buffer(16);
    buf.writeBytes(surrogateString.getBytes(CharsetUtil.UTF_8));
    ByteBuf buf2 = Unpooled.buffer(16);
    ByteBufUtil.writeUtf8(buf2, surrogateString);

