public void equalsHashCode() {
    EnhancedTypeDocumentConfiguration configuration =
        EnhancedTypeDocumentConfiguration.builder()
                                         .preserveEmptyObject(true)
                                         .ignoreNulls(false)
                                         .build();

    EnhancedTypeDocumentConfiguration another =
