                                         .preserveEmptyObject(true)
                                         .ignoreNulls(false)
                                         .build();

    EnhancedTypeDocumentConfiguration different =
        EnhancedTypeDocumentConfiguration.builder()
                                         .preserveEmptyObject(false)
